(1, '000001', 'วัตถุประสงค์และขอบเขตการใช้บังคับของนโยบาย', 'buyer', 'personal', '2022-07-20', '<p>1.1 นโยบายฉบับนี้มีขึ้นเพื่อชี้แจงให้ท่านในฐานะเจ้าของข้อมูลส่วนบุคคลทราบถึงวัตถุประสงค์และรายละเอียดของการเก็บรวบรวม ใช้ และ/หรือเปิดเผยข้อมูลส่วนบุคคล ตลอดจนสิทธิและความคุ้มครองตามกฎหมายของท่าน&nbsp;</p>\r\n\r\n<p>1.2 นโยบายฉบับนี้มีผลบังคับใช้ร่วมกับประกาศ ข้อความสัญญาและข้อความความยินยอมอื่น ๆ ที่เกี่ยวข้องกับการการเก็บรวบรวม ใช้ และ/หรือเปิดเผยข้อมูลส่วนบุคคลของท่านโดย CPN และไม่มีจุดประสงค์ในการแทนที่ประกาศ ข้อความสัญญาและข้อความยินยอมดังกล่าวเว้นแต่ CPN ระบุไว้เป็นอย่างอื่นโดยชัดแจ้ง</p>\r\n\r\n<p>1.3 ให้นโยบายฉบับนี้มีผลใช้บังคับกับการให้บริการต่างๆ และการประกอบกิจการตลอดจนธุรกรรมต่างๆ ระหว่าง CPN กับท่าน ไม่ว่าในรูปแบบใดและไม่ว่าโดยอาศัยช่องทางใด ซึ่งรวมถึงการให้บริการผ่านสื่ออิเล็กทรอนอกส์ผ่านเว็บไซต์ และแพลตฟอร์มต่างๆ ของ CPN&nbsp;</p>\r\n\r\n<p>1.4 ท่านสามารถเข้าสู่เว็บไซต์และแพลตฟอร์มของ CPN ได้โดยไม่จำเป็นต้องเป็นสมาชิกหรือมีบัญชีกับ CPN อย่างไรก็ตาม ท่านอาจไม่สามารถใช้งานหรือรับบริการในบางลักษณะได้หากมิได้เป็นสมาชิกหรือมีบัญชีกับ CPN</p>\r\n\r\n<p>1.5 การที่ท่านตกลงสมัครสมาชิกหรือลงทะเบียนบัญชีในแพลตฟอร์มของ CPN ถือว่าท่านได้รับทราบและตกลงยอมรับ และยินยอมให้ CPN สามารถเก็บรวบรวม ใช้ และ/หรือ เปิดเผยข้อมูลส่วนบุคคลเพื่อวัตถุประสงค์ต่างๆ ที่ระบุไว้ในนโยบายฉบับนี้&nbsp; และหากท่านปฏิเสธไม่ให้ข้อมูลส่วนบุคคลกับ CPN หรือเพิกถอนความยินยอม อาจส่งผลกระทบต่อท่านในการใช้งานแพลตฟอร์ม รวมถึงอาจไม่ได้รับการให้บริการในบางกรณี ไม่ได้รับความสะดวก หรือไม่ได้รับการปฏิบัติตามสัญญา ซึ่งท่านอาจได้รับความเสียหายหรือเสียโอกาสได้</p>\r\n\r\n<p>1.6 กรณีที่ท่านลงทะเบียนสร้างบัญชีในแพลตฟอร์มของ CPN โดยใช้การเชื่อมต่อบัญชีหรืออ้างอิงจากข้อมูลส่วนบุคคลของท่านในแพลตฟอร์มอื่น เช่น เครือข่ายสังคมออนไลน์ ถือว่าท่านได้รับทราบและตกลงยินยอมให้ CPN สามารถเข้าถึงข้อมูลส่วนบุคคลของท่านจากแหล่งดังกล่าวได้</p>\r\n\r\n<p>1.7 ท่านจะต้องเก็บรักษาบัญชีของท่านและรหัสผ่านไว้เป็นความลับและไม่เปิดเผยให้แก่บุคคลอื่นใด และท่านจะต้องรับผิดชอบต่อการใช้งาน การออกคำสั่ง และการดำเนินการใดๆ ผ่านบัญชีของท่านด้วยตนเอง</p>\r\n\r\n<p>1.8 CPN ไม่มีนโยบายในการขายสินค้าหรือให้บริการใดๆ แก่ผู้เยาว์หรือบุคคลใดที่ถูกจำกัดความสามารถในการทำนิติกรรมตามกฎหมาย และไม่มีเจตนาที่จะเก็บรวบรวม ใช้ และ/หรือเปิดเผยข้อมูลของบุคคลดังกล่าว ในกรณีท่านเป็นผู้เยาว์ หรือถูกจำกัดความสามารถในการทำนิติกรรมตามกฎหมาย ท่านจะสามารถเข้าสู่เว็บไซต์ แพลตฟอร์ม รวมทั้งขอรับบริการต่างๆ จาก CPN ได้ก็ต่อเมื่อได้รับความยินยอมของบุคคลที่มีอำนาจหน้าที่ตามกฎหมายแล้วเท่านั้น</p>', '', '1', 'oan', NULL, '2022-07-20 07:55:18', '2022-07-20 07:55:18');
